// SPDX-License-Identifier: MIT
pragma solidity >=0.8.13;
pragma abicoder v2;

import "./SwapAndDistribute.sol";
import "./IWNative.sol";

address constant WBNB = 0xae13d989daC2f0dEbFf460aC112a837C89BAa7cd; // Wraped BNB on Binance Smart Chain testnet

IWNative constant wbnb = IWNative(WBNB);

ISwapRouter constant swapRouterBNB = ISwapRouter(
    0x1b81D678ffb9C0263b24A97847620C99d213eB14 // official PancakeSwap v3 router on testnet
);

contract SwapAndDistributeTestBNB is SwapAndDistribute {
    function getNativeAddress() internal pure override returns (address) {
        return WBNB;
    }

    function convertWrapped(uint256 amount) internal override {
        wbnb.deposit{ value: amount }();
    }

    function getRouter() internal pure override returns (ISwapRouter) {
        return swapRouterBNB;
    }
}
